import React from "react";
import FullCalendar from "@fullcalendar/react";
import timeGridPlugin from "@fullcalendar/timegrid";

function Home(props) {
  return (
    <div className="bg-image">
      <FullCalendar
        plugins={[timeGridPlugin]}
        initialView="timeGridDay"
        allDaySlot={false}
        eventMinHeight={20}
        eventShortHeight={20}
        slotDuration='00:05:00'
        slotMaxTime='24:00:00'
        events={[
          {
            title: "Event 1",
            start: "2022-04-19T09:00:00",
          },
          {
            title: "Event 2",
            start: "2022-04-19T09:00:00",

          },
          {
            title: "Event 3",
            start: "2022-04-19T09:00:00",

          },
          {
            title: "Event 4",
            start: "2022-04-19T09:00:00",

          },
          {
            title: "Event 5",
            start: "2022-04-19T09:45:00",

          },
          {
            title: "Event 6",
            start: "2022-04-19T09:45:00",

          },
          {
            title: "Event 7",
            start: "2022-04-19T09:45:00",

          },
          {
            title: "Event 8",
            start: "2022-04-19T09:45:00",

          },
          {
            title: "Event 9",
            start: "2022-04-19T09:45:00",

          },
          {
            title: "Event 10",
            start: "2022-04-19T09:45:00",

          }
        ]}
      />
    </div>
  );
}

export default Home;
